     1→/*
     2→ * tclc.h - TCL Core Host Interface
     3→ *
     4→ * This header defines the interface between the TCL core (implemented in C)
     5→ * and the host language (Go). The C core handles parsing, evaluation, and
     6→ * control flow. The host provides memory management, data structures, I/O,
     7→ * and OS services.
     8→ *
     9→ * Design principles:
    10→ *   - C core is allocation-free and stdlib-free (except math.h)
    11→ *   - All dynamic storage managed by host via callbacks
    12→ *   - Host provides GC, so no explicit reference counting in C
    13→ *   - Multiple interpreters supported via context handles
    14→ *   - Coroutines supported via non-recursive eval (trampoline)
    15→ */
    16→
    17→#ifndef TCLC_H
    18→#define TCLC_H
    19→
    20→#include <stddef.h>
    21→#include <stdint.h>
    22→
    23→#ifdef __cplusplus
    24→extern "C" {
    25→#endif
    26→
    27→/* ========================================================================
    28→ * Forward Declarations
    29→ * ======================================================================== */
    30→
    31→typedef struct TclObj TclObj;           /* Opaque value handle (host-managed) */
    32→typedef struct TclChannel TclChannel;   /* Opaque I/O channel (host-managed) */
    33→typedef struct TclProcess TclProcess;   /* Opaque subprocess (host-managed) */
    34→typedef struct TclInterp TclInterp;     /* Interpreter state (C-managed) */
    35→typedef struct TclFrame TclFrame;       /* Activation record (host-allocated) */
    36→typedef struct TclHost TclHost;         /* Host callback table */
    37→typedef struct TclCmdInfo TclCmdInfo;   /* Command lookup result */
    38→typedef void *TclTimerToken;            /* Event loop timer handle */
    39→
    40→/* ========================================================================
    41→ * Result Codes
    42→ * ======================================================================== */
    43→
    44→typedef enum TclResult {
    45→    TCL_OK       = 0,   /* Normal completion */
    46→    TCL_ERROR    = 1,   /* Error occurred */
    47→    TCL_RETURN   = 2,   /* return command */
    48→    TCL_BREAK    = 3,   /* break command */
    49→    TCL_CONTINUE = 4,   /* continue command */
    50→} TclResult;
    51→
    52→/* ========================================================================
    53→ * Command Dispatch
    54→ * ======================================================================== */
    55→
    56→/* Result of command lookup */
    57→typedef enum TclCmdType {
    58→    TCL_CMD_NOT_FOUND = 0,
    59→    TCL_CMD_BUILTIN,      /* Implemented in C, use builtinId */
    60→    TCL_CMD_PROC,         /* TCL proc, use procHandle */
    61→    TCL_CMD_EXTENSION,    /* Host-implemented, call through extInvoke */
    62→    TCL_CMD_ALIAS,        /* Cross-interpreter alias */
    63→} TclCmdType;
    64→
    65→struct TclCmdInfo {
    66→    TclCmdType type;
    67→    union {
    68→        int    builtinId;     /* TCL_CMD_BUILTIN: index into C builtin table */
    69→        void  *procHandle;    /* TCL_CMD_PROC: opaque handle to proc def */
    70→        void  *extHandle;     /* TCL_CMD_EXTENSION: opaque handle for callback */
    71→        void  *aliasHandle;   /* TCL_CMD_ALIAS: alias data */
    72→    } u;
    73→};
    74→
    75→/* Command procedure signature (builtins and extensions) */
    76→typedef TclResult (*TclCmdProc)(
    77→    TclInterp *interp,
    78→    void      *clientData,
    79→    int        objc,
    80→    TclObj   **objv
    81→);
    82→
    83→/* Socket accept callback */
    84→typedef void (*TclAcceptProc)(
    85→    void       *clientData,
    86→    TclChannel *chan,
    87→    const char *addr,
    88→    int         port
    89→);
    90→
    91→/* Variable trace callback */
    92→typedef void (*TclTraceProc)(
    93→    void       *clientData,
    94→    const char *name,
    95→    int         op
    96→);
    97→
    98→/* Trace operation flags */
    99→typedef enum TclTraceOp {
   100→    TCL_TRACE_READ   = (1 << 0),
   101→    TCL_TRACE_WRITE  = (1 << 1),
   102→    TCL_TRACE_UNSET  = (1 << 2),
   103→} TclTraceOp;
   104→
   105→/* Event loop flags */
   106→typedef enum TclEventFlag {
   107→    TCL_EVENT_FILE   = (1 << 0),
   108→    TCL_EVENT_TIMER  = (1 << 1),
   109→    TCL_EVENT_IDLE   = (1 << 2),
   110→    TCL_EVENT_ALL    = 0xFF,
   111→    TCL_EVENT_NOWAIT = (1 << 8),
   112→} TclEventFlag;
   113→
   114→/* Channel event mask */
   115→typedef enum TclChannelMask {
   116→    TCL_READABLE = (1 << 0),
   117→    TCL_WRITABLE = (1 << 1),
   118→} TclChannelMask;
   119→
   120→/* Process spawn flags */
   121→typedef enum TclProcessFlag {
   122→    TCL_PROCESS_PIPE_STDIN  = (1 << 0),
   123→    TCL_PROCESS_PIPE_STDOUT = (1 << 1),
   124→    TCL_PROCESS_PIPE_STDERR = (1 << 2),
   125→    TCL_PROCESS_BACKGROUND  = (1 << 3),
   126→} TclProcessFlag;
   127→
   128→/* Socket flags */
   129→typedef enum TclSocketFlag {
   130→    TCL_SOCKET_ASYNC = (1 << 0),
   131→} TclSocketFlag;
   132→
   133→/* Glob type flags */
   134→typedef enum TclGlobType {
   135→    TCL_GLOB_TYPE_FILE = (1 << 0),
   136→    TCL_GLOB_TYPE_DIR  = (1 << 1),
   137→    TCL_GLOB_TYPE_LINK = (1 << 2),
   138→} TclGlobType;
   139→
   140→/* Seek whence */
   141→typedef enum TclSeekWhence {
   142→    TCL_SEEK_SET = 0,
   143→    TCL_SEEK_CUR = 1,
   144→    TCL_SEEK_END = 2,
   145→} TclSeekWhence;
   146→
   147→/* ========================================================================
   148→ * Activation Record (Frame)
   149→ *
   150→ * Host allocates these (for coroutine support - frames outlive arena LIFO).
   151→ * C core defines the structure.
   152→ * ======================================================================== */
   153→
   154→typedef enum TclFrameFlag {
   155→    TCL_FRAME_PROC      = (1 << 0),  /* Frame is a proc call */
   156→    TCL_FRAME_GLOBAL    = (1 << 1),  /* Global frame */
   157→    TCL_FRAME_NAMESPACE = (1 << 2),  /* Namespace eval frame */
   158→    TCL_FRAME_COROUTINE = (1 << 3),  /* Coroutine base frame */
   159→} TclFrameFlag;
   160→
   161→struct TclFrame {
   162→    TclFrame   *parent;         /* Calling frame (NULL for global) */
   163→    void       *varsHandle;     /* Host-managed variable table */
   164→    void       *nsHandle;       /* Namespace handle (NULL = current) */
   165→    const char *procName;       /* Proc name for stack traces, or NULL */
   166→    uint32_t    level;          /* Call depth from global */
   167→    uint32_t    flags;          /* TCL_FRAME_* flags */
   168→
   169→    /* Coroutine resume state (valid when frame is suspended) */
   170→    int         resumeCmdIndex; /* Command index to resume at */
   171→    int         resumePhase;    /* Parse phase to resume at */
   172→    void       *resumeState;    /* Opaque parse/eval state */
   173→};
   174→
   175→/* ========================================================================
   176→ * Interpreter State
   177→ *
   178→ * Managed by C core. Contains current execution state.
   179→ * ======================================================================== */
   180→
   181→struct TclInterp {
   182→    const TclHost *host;        /* Host callback table (shared) */
   183→    void          *hostCtx;     /* Per-interp host context */
   184→
   185→    TclFrame      *globalFrame; /* Bottom of frame stack */
   186→    TclFrame      *currentFrame;/* Current execution frame */
   187→
   188→    TclObj        *result;      /* Command result / return value */
   189→    TclResult      resultCode;  /* TCL_OK, TCL_ERROR, etc. */
   190→
   191→    /* Error information */
   192→    TclObj        *errorInfo;   /* Stack trace */
   193→    TclObj        *errorCode;   /* Machine-readable error code */
   194→    int            errorLine;   /* Line number of error */
   195→
   196→    /* Return options (for return -code, -level) */
   197→    int            returnCode;
   198→    int            returnLevel;
   199→
   200→    /* Coroutine state */
   201→    void          *currentCoro; /* Current coroutine, or NULL */
   202→
   203→    /* Script tracking (for info script) */
   204→    const char    *scriptFile;  /* Current source file, or NULL */
   205→    int            scriptLine;  /* Current line number */
   206→
   207→    /* Parent interpreter (for interp create) */
   208→    TclInterp     *parent;
   209→    int            isSafe;      /* Safe interpreter flag */
   210→};
   211→
   212→/* ========================================================================
   213→ * Host Callback Interface
   214→ *
   215→ * The host (Go) provides this table of function pointers.
   216→ * All callbacks that access per-interpreter state take a context handle.
   217→ * ======================================================================== */
   218→
   219→struct TclHost {
   220→
   221→    /* ==================================================================
   222→     * Interpreter Context
   223→     *
   224→     * Each interpreter has an opaque host context. Child interpreters
   225→     * reference their parent's context for channel sharing, aliases, etc.
   226→     * ================================================================== */
   227→
   228→    void* (*interpContextNew)(void *parentCtx, int safe);
   229→    void  (*interpContextFree)(void *ctx);
   230→
   231→    /* ==================================================================
   232→     * Frame Allocation
   233→     *
   234→     * Frames must outlive LIFO arena ordering (for coroutines).
   235→     * Host allocates from GC-managed memory.
   236→     * ================================================================== */
   237→
   238→    TclFrame* (*frameAlloc)(void *ctx);
   239→    void      (*frameFree)(void *ctx, TclFrame *frame);
   240→
   241→    /* ==================================================================
   242→     * Objects (Values)
   243→     *
   244→     * All TCL values are host-managed. The host handles:
   245→     *   - String representation caching (shimmering)
   246→     *   - Type conversions
   247→     *   - Garbage collection
   248→     * ================================================================== */
   249→
   250→    /* Constructors */
   251→    TclObj* (*newString)(const char *s, size_t len);
   252→    TclObj* (*newInt)(int64_t val);
   253→    TclObj* (*newDouble)(double val);
   254→    TclObj* (*newBool)(int val);
   255→    TclObj* (*newList)(TclObj **elems, size_t count);
   256→    TclObj* (*newDict)(void);
   257→    TclObj* (*dup)(TclObj *obj);
   258→
   259→    /* String representation (always available) */
   260→    const char* (*getStringPtr)(TclObj *obj, size_t *lenOut);
   261→
   262→    /* Type conversions (may fail, return 0 on success) */
   263→    int (*asInt)(TclObj *obj, int64_t *out);
   264→    int (*asDouble)(TclObj *obj, double *out);
   265→    int (*asBool)(TclObj *obj, int *out);
   266→    int (*asList)(TclObj *obj, TclObj ***elemsOut, size_t *countOut);
   267→
   268→    /* ==================================================================
   269→     * List Operations
   270→     * ================================================================== */
   271→
   272→    size_t  (*listLength)(TclObj *list);
   273→    TclObj* (*listIndex)(TclObj *list, size_t idx);
   274→    TclObj* (*listRange)(TclObj *list, size_t first, size_t last);
   275→    TclObj* (*listSet)(TclObj *list, size_t idx, TclObj *val);
   276→    TclObj* (*listAppend)(TclObj *list, TclObj *elem);
   277→    TclObj* (*listConcat)(TclObj *a, TclObj *b);
   278→    TclObj* (*listInsert)(TclObj *list, size_t idx, TclObj **elems, size_t count);
   279→    TclObj* (*listSort)(TclObj *list, int flags);  /* flags: 1=decreasing, 2=integer */
   280→
   281→    /* ==================================================================
   282→     * Dict Operations
   283→     * ================================================================== */
   284→
   285→    TclObj* (*dictGet)(TclObj *dict, TclObj *key);
   286→    TclObj* (*dictSet)(TclObj *dict, TclObj *key, TclObj *val);
   287→    int     (*dictExists)(TclObj *dict, TclObj *key);
   288→    TclObj* (*dictKeys)(TclObj *dict, const char *pattern);
   289→    TclObj* (*dictValues)(TclObj *dict, const char *pattern);
   290→    TclObj* (*dictRemove)(TclObj *dict, TclObj *key);
   291→    size_t  (*dictSize)(TclObj *dict);
   292→
   293→    /* ==================================================================
   294→     * String Operations
   295→     *
   296→     * String length/index are in characters (Unicode code points),
   297→     * not bytes. Host handles UTF-8 encoding.
   298→     * ================================================================== */
   299→
   300→    size_t  (*stringLength)(TclObj *str);
   301→    TclObj* (*stringIndex)(TclObj *str, size_t idx);
   302→    TclObj* (*stringRange)(TclObj *str, size_t first, size_t last);
   303→    TclObj* (*stringConcat)(TclObj **parts, size_t count);
   304→    int     (*stringCompare)(TclObj *a, TclObj *b);
   305→    int     (*stringCompareNocase)(TclObj *a, TclObj *b);
   306→    int     (*stringMatch)(const char *pattern, TclObj *str, int nocase);
   307→    TclObj* (*stringToLower)(TclObj *str);
   308→    TclObj* (*stringToUpper)(TclObj *str);
   309→    TclObj* (*stringTrim)(TclObj *str, const char *chars);
   310→    TclObj* (*stringReplace)(TclObj *str, size_t first, size_t last, TclObj *rep);
   311→    int     (*stringFirst)(TclObj *needle, TclObj *haystack, size_t start);
   312→    int     (*stringLast)(TclObj *needle, TclObj *haystack, size_t start);
   313→
   314→    /* ==================================================================
   315→     * Arena Allocation
   316→     *
   317→     * Arenas provide bump-pointer allocation for parse/eval temporaries.
   318→     * LIFO discipline: must pop in reverse order of push.
   319→     * ================================================================== */
   320→
   321→    void*  (*arenaPush)(void *ctx);
   322→    void   (*arenaPop)(void *ctx, void *arena);
   323→    void*  (*arenaAlloc)(void *arena, size_t size, size_t align);
   324→    char*  (*arenaStrdup)(void *arena, const char *s, size_t len);
   325→    size_t (*arenaMark)(void *arena);
   326→    void   (*arenaReset)(void *arena, size_t mark);
   327→
   328→    /* ==================================================================
   329→     * Variables (Scalars)
   330→     *
   331→     * Each frame has a varsHandle for local variables.
   332→     * The host special-cases "env" array to route to environment.
   333→     * ================================================================== */
   334→
   335→    void*   (*varsNew)(void *ctx);
   336→    void    (*varsFree)(void *ctx, void *vars);
   337→    TclObj* (*varGet)(void *vars, const char *name, size_t len);
   338→    void    (*varSet)(void *vars, const char *name, size_t len, TclObj *val);
   339→    void    (*varUnset)(void *vars, const char *name, size_t len);
   340→    int     (*varExists)(void *vars, const char *name, size_t len);
   341→    TclObj* (*varNames)(void *vars, const char *pattern);
   342→    void    (*varLink)(void *localVars, const char *localName, size_t localLen,
   343→                       void *targetVars, const char *targetName, size_t targetLen);
   344→
   345→    /* ==================================================================
   346→     * Arrays
   347→     *
   348→     * TCL arrays are associative: $arr(key) syntax.
   349→     * Distinct from lists and dicts.
   350→     * ================================================================== */
   351→
   352→    void    (*arraySet)(void *vars, const char *arr, size_t arrLen,
   353→                        const char *key, size_t keyLen, TclObj *val);
   354→    TclObj* (*arrayGet)(void *vars, const char *arr, size_t arrLen,
   355→                        const char *key, size_t keyLen);
   356→    int     (*arrayExists)(void *vars, const char *arr, size_t arrLen,
   357→                           const char *key, size_t keyLen);
   358→    TclObj* (*arrayNames)(void *vars, const char *arr, size_t arrLen,
   359→                          const char *pattern);
   360→    void    (*arrayUnset)(void *vars, const char *arr, size_t arrLen,
   361→                          const char *key, size_t keyLen);
   362→    size_t  (*arraySize)(void *vars, const char *arr, size_t arrLen);
   363→
   364→    /* ==================================================================
   365→     * Variable Traces
   366→     *
   367→     * For vwait, trace command, etc.
   368→     * ================================================================== */
   369→
   370→    void (*traceVarAdd)(void *vars, const char *name, size_t len, int ops,
   371→                        TclTraceProc callback, void *clientData);
   372→    void (*traceVarRemove)(void *vars, const char *name, size_t len,
   373→                           TclTraceProc callback, void *clientData);
   374→
   375→    /* ==================================================================
   376→     * Commands
   377→     *
   378→     * Command lookup returns type + handle. C has static builtin table.
   379→     * Host manages procs, extensions, aliases.
   380→     * ================================================================== */
   381→
   382→    int       (*cmdLookup)(void *ctx, const char *name, size_t len,
   383→                           TclCmdInfo *out);
   384→    void*     (*procRegister)(void *ctx, const char *name, size_t len,
   385→                              TclObj *argList, TclObj *body);
   386→    int       (*procGetDef)(void *handle, TclObj **argListOut, TclObj **bodyOut);
   387→    TclResult (*extInvoke)(TclInterp *interp, void *handle,
   388→                           int objc, TclObj **objv);
   389→    int       (*cmdRename)(void *ctx, const char *oldName, size_t oldLen,
   390→                           const char *newName, size_t newLen);
   391→    int       (*cmdDelete)(void *ctx, const char *name, size_t len);
   392→    int       (*cmdExists)(void *ctx, const char *name, size_t len);
   393→    TclObj*   (*cmdList)(void *ctx, const char *pattern);
   394→    void      (*cmdHide)(void *ctx, const char *name, size_t len);
   395→    void      (*cmdExpose)(void *ctx, const char *name, size_t len);
   396→
   397→    /* ==================================================================
   398→     * Channels (I/O)
   399→     *
   400→     * Abstract I/O handles. Host manages buffering, encoding.
   401→     * Channels can be shared between interpreters.
   402→     * ================================================================== */
   403→
   404→    TclChannel* (*chanOpen)(void *ctx, const char *name, const char *mode);
   405→    void        (*chanClose)(void *ctx, TclChannel *chan);
   406→    TclChannel* (*chanStdin)(void *ctx);
   407→    TclChannel* (*chanStdout)(void *ctx);
   408→    TclChannel* (*chanStderr)(void *ctx);
   409→    int         (*chanRead)(TclChannel *chan, char *buf, size_t len);
   410→    int         (*chanWrite)(TclChannel *chan, const char *buf, size_t len);
   411→    TclObj*     (*chanGets)(TclChannel *chan, int *eofOut);
   412→    int         (*chanFlush)(TclChannel *chan);
   413→    int         (*chanSeek)(TclChannel *chan, int64_t offset, int whence);
   414→    int64_t     (*chanTell)(TclChannel *chan);
   415→    int         (*chanEof)(TclChannel *chan);
   416→    int         (*chanBlocked)(TclChannel *chan);
   417→    int         (*chanConfigure)(TclChannel *chan, const char *opt, TclObj *val);
   418→    TclObj*     (*chanCget)(TclChannel *chan, const char *opt);
   419→    TclObj*     (*chanNames)(void *ctx, const char *pattern);
   420→    void        (*chanShare)(void *fromCtx, void *toCtx, TclChannel *chan);
   421→    void        (*chanTransfer)(void *fromCtx, void *toCtx, TclChannel *chan);
   422→
   423→    /* ==================================================================
   424→     * Event Loop
   425→     *
   426→     * Timers, channel events, idle callbacks.
   427→     * Host owns the event loop; C commands register handlers.
   428→     * ================================================================== */
   429→
   430→    TclTimerToken (*afterMs)(void *ctx, int ms, TclObj *script);
   431→    TclTimerToken (*afterIdle)(void *ctx, TclObj *script);
   432→    void          (*afterCancel)(void *ctx, TclTimerToken token);
   433→    TclObj*       (*afterInfo)(void *ctx, TclTimerToken token);
   434→    void          (*fileeventSet)(void *ctx, TclChannel *chan,
   435→                                  int mask, TclObj *script);
   436→    TclObj*       (*fileeventGet)(void *ctx, TclChannel *chan, int mask);
   437→    int           (*doOneEvent)(void *ctx, int flags);
