   439→    /* ==================================================================
   440→     * Subprocess Execution
   441→     * ================================================================== */
   442→
   443→    TclProcess* (*processSpawn)(const char **argv, int argc, int flags,
   444→                                TclChannel **pipeIn,
   445→                                TclChannel **pipeOut,
   446→                                TclChannel **pipeErr);
   447→    int   (*processWait)(TclProcess *proc, int *exitCode);
   448→    int   (*processPid)(TclProcess *proc);
   449→    void  (*processKill)(TclProcess *proc, int signal);
   450→
   451→    /* ==================================================================
   452→     * Sockets
   453→     * ================================================================== */
   454→
   455→    TclChannel* (*socketOpen)(const char *host, int port, int flags);
   456→    void*       (*socketListen)(const char *addr, int port,
   457→                                TclAcceptProc onAccept, void *clientData);
   458→    void        (*socketListenClose)(void *listener);
   459→
   460→    /* ==================================================================
   461→     * Filesystem
   462→     * ================================================================== */
   463→
   464→    int     (*fileExists)(const char *path);
   465→    int     (*fileIsFile)(const char *path);
   466→    int     (*fileIsDir)(const char *path);
   467→    int     (*fileReadable)(const char *path);
   468→    int     (*fileWritable)(const char *path);
   469→    int     (*fileExecutable)(const char *path);
   470→    int64_t (*fileSize)(const char *path);
   471→    int64_t (*fileMtime)(const char *path);
   472→    int64_t (*fileAtime)(const char *path);
   473→    int     (*fileDelete)(const char *path, int force);
   474→    int     (*fileRename)(const char *oldPath, const char *newPath, int force);
   475→    int     (*fileMkdir)(const char *path);
   476→    int     (*fileCopy)(const char *src, const char *dst, int force);
   477→    TclObj* (*fileDirname)(const char *path);
   478→    TclObj* (*fileTail)(const char *path);
   479→    TclObj* (*fileExtension)(const char *path);
   480→    TclObj* (*fileRootname)(const char *path);
   481→    TclObj* (*fileJoin)(TclObj **parts, size_t count);
   482→    TclObj* (*fileNormalize)(const char *path);
   483→    TclObj* (*fileSplit)(const char *path);
   484→    TclObj* (*fileType)(const char *path);
   485→    TclObj* (*glob)(const char *pattern, int types, const char *directory);
   486→
   487→    /* ==================================================================
   488→     * System
   489→     * ================================================================== */
   490→
   491→    int     (*chdir)(const char *path);
   492→    TclObj* (*getcwd)(void);
   493→    TclObj* (*sysHostname)(void);
   494→    TclObj* (*sysExecutable)(void);
   495→    int     (*sysPid)(void);
