   497→    /* ==================================================================
   498→     * Regular Expressions
   499→     *
   500→     * Returns list of match indices, or NULL on no match.
   501→     * ================================================================== */
   502→
   503→    TclObj* (*regexMatch)(const char *pattern, size_t patLen,
   504→                          TclObj *str, int flags);
   505→    TclObj* (*regexSubst)(const char *pattern, size_t patLen,
   506→                          TclObj *str, TclObj *replacement, int flags);
   507→
   508→    /* ==================================================================
   509→     * Clock / Time
   510→     * ================================================================== */
   511→
   512→    int64_t (*clockSeconds)(void);
   513→    int64_t (*clockMillis)(void);
   514→    int64_t (*clockMicros)(void);
   515→    TclObj* (*clockFormat)(int64_t time, const char *fmt, const char *tz);
   516→    int64_t (*clockScan)(const char *str, const char *fmt, const char *tz);
